import '../css/style.css';
import '../css/index.css';
import React from 'react';
import Booking from './booking.jsx';

export default function Intro() {
    return (
        <div className='container intro'>
            <div className='row'>
                <div className='column'>
                    <p>Discover the ultimate convenience in travel planning with Travel World. Whether you’re embarking on a weekend getaway, a business trip, or the vacation of a lifetime, we’re here to make your journey seamless and stress-free.</p>
                </div>
            </div>
        </div>
    );
}
